import React from 'react';
import SectionHeader from '../../components/SectionHeader/SectionHeader';
import ServiceOverview from '../../components/ServiceOverview/ServiceOverview';
import { useThemeSettings } from '../../context/ThemeSettingsContext';
import './ServicesPage.css';

const ServicesPage = () => {
  const themeSettings = useThemeSettings();

  const service = [
    {
      title: 'Web Development',
      description: 'Custom web solutions for your business.',
      metric: 'Starting at $500',
      IconComponent: () => <i className="fas fa-code" />,
    },
    {
      title: 'Mobile Development',
      description: 'Build mobile apps for iOS and Android.',
      metric: 'Starting at $1000',
      IconComponent: () => <i className="fas fa-mobile-alt" />,
    },
    {
      title: 'SEO & Marketing',
      description: 'Improve your online presence and reach.',
      metric: 'Starting at $1500',
      IconComponent: () => <i className="fas fa-chart-line" />,
    },
    {
      title: 'Consulting',
      description: 'Expert advice for your tech projects.',
      metric: 'Starting at $2000',
      IconComponent: () => <i className="fas fa-lightbulb" />,
    },
  ];

  return (
    <div
      className="services-page"
      style={{
        backgroundColor: themeSettings.colors.background,
        color: themeSettings.colors.text,
        fontFamily: themeSettings.typography.fontFamily,
      }}
    >
      <SectionHeader
        title="Our Services"
        subtitle="Explore the wide range of services we offer."
      />
      <ServiceOverview service={service} />
      <div className="pricing-tiers">
        <h3>Choose Your Plan</h3>
        <div className="tiers">
          <div className="tier">
            <h4>Basic</h4>
            <p>Essential services to get started.</p>
            <p>Price: $500/month</p>
          </div>
          <div className="tier">
            <h4>Premium</h4>
            <p>Advanced features for growing businesses.</p>
            <p>Price: $1000/month</p>
          </div>
          <div className="tier">
            <h4>Ultimate</h4>
            <p>All-inclusive for full-scale operations.</p>
            <p>Price: $1500/month</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ServicesPage;
